def calculate_max_profit(n, h, m, restrictions):
    heights = [h] / (n + 1)
    for (l, r, x) in restrictions:
        for i in range(l, r + 1):
            heights[i] = min(heights[i], x)
    max_profit = sum((height ** 2 for height in heights[1:]))
    return max_profit

